 - "·":
    - test:
        if: "$SpeechStyle != 'ClearSpeak' or $ClearSpeak_MultSymbolDot = 'Auto'"
        then: [T: "ganger"]                          #     (en: 'times', google translation)
        else: [T: "midtstilt prikk"]                  #     (en: 'dot', MathPlayer: 'mellanpunkt', google: 'punkt')
 - "×":                                             #  0xd7
    - test:
        if: "$SpeechStyle != 'ClearSpeak' or $ClearSpeak_MultSymbolX = 'Auto'"
        then: [T: "ganger"]                          #     (en: 'times', google translation)
        else_test:
            if: $ClearSpeak_MultSymbolX = 'By'
            then: [T: "ganger"]                      #     (en: 'by', google translation)
            else: [T: "kryss"]                     #     (en: 'cross')
 - "÷": [T: "delt på"]                             #  0xf7    (en: 'divided by')
 #-------------------------------------------------------------------------------------------------------
 # SWEDISH: The Swedish character translations are based on the placement and appearance of the characters rather than their function, as function might be context-dependent. Placement above is used as the baseline, and low characters are translated as "låg(t)" (eng "low"). In most cases, no difference has been made in the translation between non-combining, modifier (Spacing Modifier Letters), and combining/embellishment characters. However, in the case of alphabetical letters and punctuation marks as modifier characters (such as modifier small h or comma embellishment), the construction "med ...( efter)" (eng "with ...( placed after it)") is used to prevent any possible ambiguity.
